/** 
 * Creates a builder with the specified custom components. <p>Note that this constructor is only useful if you try to ensure that ExoPlayer's default components can be removed by ProGuard or R8. For most components except renderers, there is only a marginal benefit of doing that.
 * @param renderers The {@link Renderer Renderers} to be used by the player.
 * @param trackSelector A {@link TrackSelector}.
 * @param loadControl A {@link LoadControl}.
 * @param bandwidthMeter A {@link BandwidthMeter}.
 * @param looper A {@link Looper} that must be used for all calls to the player.
 * @param analyticsCollector An {@link AnalyticsCollector}.
 * @param useLazyPreparation Whether media sources should be initialized lazily.
 * @param clock A {@link Clock}. Should always be  {@link Clock#DEFAULT}.
 */
public Builder(Renderer[] renderers,TrackSelector trackSelector,LoadControl loadControl,BandwidthMeter bandwidthMeter,Looper looper,AnalyticsCollector analyticsCollector,boolean useLazyPreparation,Clock clock){
  Assertions.checkArgument(renderers.length > 0);
  this.renderers=renderers;
  this.trackSelector=trackSelector;
  this.loadControl=loadControl;
  this.bandwidthMeter=bandwidthMeter;
  this.looper=looper;
  this.analyticsCollector=analyticsCollector;
  this.useLazyPreparation=useLazyPreparation;
  this.clock=clock;
}
